import React from "react";
import "./Navbar.css";
import Home from '@material-ui/icons/Home';

function Navbar() {
    return (<div className="Navbar">
        <div className="links">
            <a href="/home"> <img src={home} alt="" width="100%" height="500em" srcset="" /></a>
            <a href="/Events">Events</a>
            <a href="/home">Home</a>
            <a href="/Events">Events</a>
            <a href="/home">Home</a>
            <a href="/Events">Events</a>
        </div>

    </div>);
}

export default Navbar;
